TEST_F(BigIntGeneratedTest, test_addition_and_subtraction_of_2048_bit_number_and_2048_bit_number_1) {
  BigInt x("");
  BigInt y("");
  string expected_sum_1 = "";
  string expected_sum_2 = "";
  string expected_sum_3 = "-";
  string expected_sum_4 = "-";
  BigInt sum_1 = x + y;
  BigInt sum_2 = x - y;
  BigInt sum_3 = -x + y;
  BigInt sum_4 = -x - y;
  EXPECT_EQ(expected_sum_1, sum_1.toDecimalString());
  EXPECT_EQ(expected_sum_2, sum_2.toDecimalString());
  EXPECT_EQ(expected_sum_3, sum_3.toDecimalString());
  EXPECT_EQ(expected_sum_4, sum_4.toDecimalString());
}

